import React from 'react'
import './userStyle.css'

function UserProfile({history}) {

    let user = JSON.stringify(history.location.state.values.name)

    user = user.replace(/['"]+/g, '');
    console.log(user);

    return (
        <div class="userStyle">
            <div>Account</div>
            Hi {user},
        </div>
    )
}

export default UserProfile
